    // –®–∞–≥ 3: –ù–∞—Ö–æ–¥–∏–º –≥–æ—Ä–æ–¥ –≤ —Å–ø—Ä–∞–≤–æ—á–Ω–∏–∫–µ –ø–æ cityID
    const cityWithTerminals = terminalsDirectoryCache.city.find((city: any) => 
      city.cityID === cityInfo.cityID
    );

    if (!cityWithTerminals) {
      console.warn(`‚ö†Ô∏è –ì–æ—Ä–æ–¥ —Å cityID ${cityInfo.cityID} –Ω–µ –Ω–∞–π–¥–µ–Ω –≤ —Å–ø—Ä–∞–≤–æ—á–Ω–∏–∫–µ —Ç–µ—Ä–º–∏–Ω–∞–ª–æ–≤`);
