      name: cityWithTerminals.name,
      cityID: cityWithTerminals.cityID,
      terminalsCount: cityWithTerminals.terminals?.terminal?.length || 0
    });

    // –®–∞–≥ 4: –§–∏–ª—å—Ç—Ä—É–µ–º —Ç–µ—Ä–º–∏–Ω–∞–ª—ã –ø–æ –Ω–∞–ø—Ä–∞–≤–ª–µ–Ω–∏—é
