    const suitableTerminals = terminals.filter((terminal: any) => {
      if (direction === 'derival') {
        return terminal.receiveCargo === true; // –ú–æ–∂–µ—Ç –ø—Ä–∏–Ω–∏–º–∞—Ç—å –≥—Ä—É–∑
      } else {
        return terminal.giveoutCargo === true; // –ú–æ–∂–µ—Ç –≤—ã–¥–∞–≤–∞—Ç—å –≥—Ä—É–∑
      }
    });

    console.log(`üöõ –ü–æ–¥—Ö–æ–¥—è—â–∏—Ö —Ç–µ—Ä–º–∏–Ω–∞–ª–æ–≤ –¥–ª—è ${direction}:`, suitableTerminals.length);

